import './App.css';
import { ProductsPage } from './pages/Products';

function App() {
  return (
    <BrowserRouter>
        <Switch>
          <Route path='/' exact component={ProductsPage} />
          <Route exact path='/search' component={SearchHome} />
          <Route component={NotFound} />
        </Switch>
    </BrowserRouter>
  );
}

export default App;
